import React, { useState,useEffect } from 'react'
import { Link, useNavigate } from 'react-router-dom';
import { toast } from "react-toastify";

export default function Admin() {
   
    const [adminPassword, passwordupdate] = useState('');
    const [adminName, userNameupdate] = useState('');

    const navigate=useNavigate();

    useEffect(() => {
         sessionStorage.clear();
        },[])
const ProceedLoginusingAPI = (e) => {
        e.preventDefault();
        if (validate()) {
            console.log('proceed');
            let inputobj={"adminName":adminName,
            "adminPassword": adminPassword};
            console.log(JSON.stringify(inputobj))
            fetch("https://localhost:5137/api/Token/Admin",{
                method:'POST',
                headers:{'content-type':'application/json'},
                body:JSON.stringify(inputobj)
            }).then((res) => {
                return res.text();
            }).then((resp) => {
                console.log(resp)
                toast.success('Success');
                localStorage.setItem('token',resp);
                navigate('/doctor')                          
            }).catch((err) => {
                toast.error('Login Failed due to :' + err.message);
            });
        }
    }


   const validate = () => {
        let result = true;
        if (adminName === '' || adminName === null) {
            result = false;
            toast.warning('Please Enter Username');
        }
        if (adminPassword === '' || adminPassword === null) {
            result = false;
            toast.warning('Please Enter Password');
        }
        return result;
    }
    return (
        <div className="row">
            <div className="offset-lg-3 col-lg-6" style={{ marginTop: '100px' }}>
                <form onSubmit={ProceedLoginusingAPI} className="container">
                    <div className="card">
                        <div className="card-header">
                            <h2>Admin Login</h2>
                        </div>
                        <div className="card-body">
                        <div className="form-group">
                                <label>Admin Name <span className="errmsg">*</span></label>
                                <input value={adminName} onChange={e => userNameupdate(e.target.value)} className="form-control"></input>
                            </div>
                            <div className="form-group">
                                <label>Password <span className="errmsg">*</span></label>
                                <input type="password" value={adminPassword} onChange={e => passwordupdate(e.target.value)} className="form-control"></input>
                            </div>
                        </div>
                        <div className="card-footer">
                            <button type="submit" className="btn btn-primary" o>Login</button> |
                            <Link className="btn btn-success" to={'/register'}>New User</Link>
                        </div>
                    </div>
                </form>
            </div>
        </div>
    )
}
